                function EnchantEditChange(s, x) {
                    if (s.toString() == "" || s.toString() == "-") {
                        var progress = -32768;
                    } else
                        var progress = parseInt(s.toString()) + 32768;
                    if (progress > 65535) {
                        x[0].setText("32767");

                        progress = 65535;
                        x[0].setSelection(5);
                    }

                    x[1].setProgress(progress);
                }

