//==//==//冲刺的算法//==//==//
function 冲刺(实体, x, y, z) {
    var a = (getYaw() % 360) * Math.PI / 180;
    var b = getPitch() * Math.PI / 180;
    xx = -Math.sin(a) * Math.cos(b);
    yy = -Math.sin(b);
    zz = Math.cos(a) * Math.cos(b);
    setVelX(实体, xx * x);
    setVelY(实体, yy * y);
    setVelZ(实体, zz * z);
}




